import React, { useState } from 'react';
import { Channel, Priority } from '../types';
import { createTicket } from '../services/mockDB';
import { processTicketWithAI } from '../services/geminiService';
import { updateTicket, addMessageToTicket } from '../services/mockDB';

const CATEGORIES = [
  { value: 'general', label: 'General Question' },
  { value: 'technical', label: 'Technical Support' },
  { value: 'billing', label: 'Billing Inquiry' },
  { value: 'bug_report', label: 'Bug Report' },
  { value: 'feedback', label: 'Feedback' }
];

const PRIORITIES = [
  { value: 'low', label: 'Low - Not urgent' },
  { value: 'medium', label: 'Medium - Need help soon' },
  { value: 'high', label: 'High - Urgent issue' }
];

export const SupportForm: React.FC = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    subject: '',
    category: 'general',
    priority: 'medium' as Priority,
    message: ''
  });

  const [status, setStatus] = useState<'idle' | 'submitting' | 'success' | 'error'>('idle');
  const [ticketId, setTicketId] = useState<string | null>(null);
  const [error, setError] = useState<string | null>(null);

  const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement | HTMLTextAreaElement>) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const validateForm = () => {
    if (formData.name.trim().length < 2) {
      setError('Please enter your name (at least 2 characters)');
      return false;
    }
    if (!/^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(formData.email)) {
      setError('Please enter a valid email address');
      return false;
    }
    if (formData.subject.trim().length < 5) {
      setError('Please enter a subject (at least 5 characters)');
      return false;
    }
    if (formData.message.trim().length < 10) {
      setError('Please describe your issue in more detail (at least 10 characters)');
      return false;
    }
    return true;
  };

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setError(null);
    if (!validateForm()) return;

    setStatus('submitting');
    try {
      // 1. Create ticket in Mock DB
      const ticket = createTicket({
        ...formData,
        channel: Channel.WEB_FORM
      });
      setTicketId(ticket.id);

      // 2. Simulate AI Employee Processing (The "FTE" logic)
      const aiResult = await processTicketWithAI(formData.message, Channel.WEB_FORM, "New Customer Inquiry");

      // 3. Store AI reply
      addMessageToTicket(ticket.id, {
        conversation_id: ticket.conversation_id,
        channel: Channel.WEB_FORM,
        direction: 'outbound',
        role: 'agent',
        content: aiResult.response,
        sentiment_score: aiResult.sentiment
      });

      // 4. Update ticket metadata
      updateTicket(ticket.id, {
        status: aiResult.should_escalate ? 'escalated' as any : 'resolved' as any,
        resolution_notes: aiResult.reason
      });

      setStatus('success');
    } catch (err: any) {
      setError(err.message || 'Submission failed');
      setStatus('error');
    }
  };

  if (status === 'success') {
    return (
      <div className="max-w-2xl mx-auto p-8 bg-white rounded-2xl shadow-xl border border-blue-50">
        <div className="text-center">
          <div className="w-20 h-20 bg-green-100 rounded-full flex items-center justify-center mx-auto mb-6">
            <svg className="w-10 h-10 text-green-500" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2.5} d="M5 13l4 4L19 7" />
            </svg>
          </div>
          <h2 className="text-3xl font-bold text-gray-900 mb-3">Thank You!</h2>
          <p className="text-gray-600 mb-6 text-lg">Your support request has been submitted successfully.</p>
          <div className="bg-gray-50 rounded-xl p-6 mb-8 border border-gray-100">
            <p className="text-sm font-medium text-gray-500 uppercase tracking-wider mb-1">Your Ticket ID</p>
            <p className="text-2xl font-mono font-bold text-blue-600">{ticketId}</p>
          </div>
          <p className="text-sm text-gray-500 italic">
            Our AI assistant has processed your request. You should receive an email confirmation shortly.
          </p>
          <button
            onClick={() => setStatus('idle')}
            className="mt-8 px-8 py-3 bg-blue-600 text-white rounded-xl font-semibold hover:bg-blue-700 transition-all shadow-lg shadow-blue-200"
          >
            Submit Another Request
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="max-w-2xl mx-auto p-8 bg-white rounded-2xl shadow-xl border border-blue-50">
      <div className="mb-8">
        <h2 className="text-3xl font-bold text-gray-900 mb-2">Contact Support</h2>
        <p className="text-gray-500 text-lg">Fill out the form below and our AI-powered support team will help you shortly.</p>
      </div>

      {error && (
        <div className="mb-6 p-4 bg-red-50 border border-red-200 rounded-xl flex items-center gap-3 text-red-700">
          <svg className="w-5 h-5" fill="currentColor" viewBox="0 0 20 20"><path fillRule="evenodd" d="M18 10a8 8 0 11-16 0 8 8 0 0116 0zm-7 4a1 1 0 11-2 0 1 1 0 012 0zm-1-9a1 1 0 00-1 1v4a1 1 0 102 0V6a1 1 0 00-1-1z" clipRule="evenodd" /></svg>
          <span className="font-medium">{error}</span>
        </div>
      )}

      <form onSubmit={handleSubmit} className="space-y-6">
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          <div>
            <label htmlFor="name" className="block text-sm font-semibold text-gray-700 mb-2">Your Name *</label>
            <input
              type="text" id="name" name="name"
              value={formData.name} onChange={handleChange}
              required
              className="w-full px-4 py-3 bg-slate-900 text-white border border-slate-700 rounded-xl focus:ring-2 focus:ring-blue-500 focus:border-transparent transition-all outline-none placeholder:text-slate-500"
              placeholder="John Doe"
            />
          </div>
          <div>
            <label htmlFor="email" className="block text-sm font-semibold text-gray-700 mb-2">Email Address *</label>
            <input
              type="email" id="email" name="email"
              value={formData.email} onChange={handleChange}
              required
              className="w-full px-4 py-3 bg-slate-900 text-white border border-slate-700 rounded-xl focus:ring-2 focus:ring-blue-500 focus:border-transparent transition-all outline-none placeholder:text-slate-500"
              placeholder="john@techcorp.com"
            />
          </div>
        </div>

        <div>
          <label htmlFor="subject" className="block text-sm font-semibold text-gray-700 mb-2">Subject *</label>
          <input
            type="text" id="subject" name="subject"
            value={formData.subject} onChange={handleChange}
            required
            className="w-full px-4 py-3 bg-slate-900 text-white border border-slate-700 rounded-xl focus:ring-2 focus:ring-blue-500 focus:border-transparent transition-all outline-none placeholder:text-slate-500"
            placeholder="Brief description of your issue"
          />
        </div>

        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          <div>
            <label htmlFor="category" className="block text-sm font-semibold text-gray-700 mb-2">Category *</label>
            <select
              id="category" name="category"
              value={formData.category} onChange={handleChange}
              className="w-full px-4 py-3 bg-slate-900 text-white border border-slate-700 rounded-xl focus:ring-2 focus:ring-blue-500 focus:border-transparent transition-all outline-none"
            >
              {CATEGORIES.map(cat => <option key={cat.value} value={cat.value} className="bg-slate-900 text-white">{cat.label}</option>)}
            </select>
          </div>
          <div>
            <label htmlFor="priority" className="block text-sm font-semibold text-gray-700 mb-2">Priority</label>
            <select
              id="priority" name="priority"
              value={formData.priority} onChange={handleChange}
              className="w-full px-4 py-3 bg-slate-900 text-white border border-slate-700 rounded-xl focus:ring-2 focus:ring-blue-500 focus:border-transparent transition-all outline-none"
            >
              {PRIORITIES.map(pri => <option key={pri.value} value={pri.value} className="bg-slate-900 text-white">{pri.label}</option>)}
            </select>
          </div>
        </div>

        <div>
          <label htmlFor="message" className="block text-sm font-semibold text-gray-700 mb-2">How can we help? *</label>
          <textarea
            id="message" name="message"
            value={formData.message} onChange={handleChange}
            required
            rows={5}
            className="w-full px-4 py-3 bg-slate-900 text-white border border-slate-700 rounded-xl focus:ring-2 focus:ring-blue-500 focus:border-transparent transition-all outline-none resize-none placeholder:text-slate-500"
            placeholder="Please describe your issue or question in detail..."
          />
          <p className="mt-2 text-xs text-gray-400 text-right">{formData.message.length}/1000 characters</p>
        </div>

        <button
          type="submit"
          disabled={status === 'submitting'}
          className={`w-full py-4 px-6 rounded-xl font-bold text-white transition-all transform hover:scale-[1.01] active:scale-[0.99] flex items-center justify-center gap-3 shadow-lg ${
            status === 'submitting' ? 'bg-gray-400 cursor-not-allowed' : 'bg-blue-600 hover:bg-blue-700 shadow-blue-200'
          }`}
        >
          {status === 'submitting' ? (
            <>
              <svg className="animate-spin h-5 w-5 text-white" fill="none" viewBox="0 0 24 24"><circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle><path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"></path></svg>
              AI Processing...
            </>
          ) : (
            'Submit Support Request'
          )}
        </button>

        <p className="text-center text-xs text-gray-400">
          By submitting, you agree to our <a href="#" className="text-blue-500 underline">Privacy Policy</a>. Our AI agents monitor this channel 24/7.
        </p>
      </form>
    </div>
  );
};

import React, { useState, useEffect } from 'react';
import { getAllTickets, getTicketById, updateTicket, addMessageToTicket } from '../services/mockDB';
import { Ticket, TicketStatus, Channel } from '../types';
import { BarChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, PieChart, Pie, Cell } from 'recharts';

const STATUS_COLORS = {
  [TicketStatus.OPEN]: 'bg-blue-100 text-blue-800',
  [TicketStatus.PROCESSING]: 'bg-yellow-100 text-yellow-800',
  [TicketStatus.RESOLVED]: 'bg-green-100 text-green-800',
  [TicketStatus.ESCALATED]: 'bg-red-100 text-red-800',
  [TicketStatus.AWAITING_HUMAN]: 'bg-purple-100 text-purple-800',
};

const CHANNEL_ICONS = {
  [Channel.EMAIL]: '',
  [Channel.WHATSAPP]: '',
  [Channel.WEB_FORM]: '',
};

export const Dashboard: React.FC = () => {
  const [tickets, setTickets] = useState<Ticket[]>([]);
  const [selectedTicket, setSelectedTicket] = useState<Ticket | null>(null);
  const [filter, setFilter] = useState<TicketStatus | 'all'>('all');

  useEffect(() => {
    setTickets(getAllTickets());
  }, []);

  const refreshData = () => {
    const all = getAllTickets();
    setTickets(all);
    if (selectedTicket) {
      const updated = all.find(t => t.id === selectedTicket.id);
      if (updated) setSelectedTicket(updated);
    }
  };

  const handleHandover = () => {
    if (!selectedTicket) return;

    updateTicket(selectedTicket.id, { status: TicketStatus.AWAITING_HUMAN });
    addMessageToTicket(selectedTicket.id, {
      conversation_id: selectedTicket.conversation_id,
      channel: selectedTicket.source_channel,
      direction: 'outbound',
      role: 'system',
      content: 'Ticket status updated: Handed over to a human agent for further assistance.'
    });

    refreshData();
  };

  const filteredTickets = filter === 'all' ? tickets : tickets.filter(t => t.status === filter);

  const stats = [
    { label: 'Total Tickets', value: tickets.length, color: 'text-gray-900' },
    { label: 'Open', value: tickets.filter(t => t.status === TicketStatus.OPEN).length, color: 'text-blue-600' },
    { label: 'Escalated', value: tickets.filter(t => t.status === TicketStatus.ESCALATED).length, color: 'text-red-600' },
    { label: 'Resolved', value: tickets.filter(t => t.status === TicketStatus.RESOLVED).length, color: 'text-green-600' },
  ];

  const chartData = [
    { name: 'Email', value: tickets.filter(t => t.source_channel === Channel.EMAIL).length },
    { name: 'WhatsApp', value: tickets.filter(t => t.source_channel === Channel.WHATSAPP).length },
    { name: 'Web Form', value: tickets.filter(t => t.source_channel === Channel.WEB_FORM).length },
  ];

  const COLORS = ['#3b82f6', '#10b981', '#f59e0b'];

  return (
    <div className="grid grid-cols-1 lg:grid-cols-4 gap-8">
      {/* Sidebar - Analytics */}
      <div className="lg:col-span-1 space-y-6">
        <div className="bg-white p-6 rounded-2xl shadow-sm border border-gray-100">
          <h3 className="text-lg font-bold mb-4">Quick Stats</h3>
          <div className="grid grid-cols-2 gap-4">
            {stats.map(s => (
              <div key={s.label} className="p-3 bg-gray-50 rounded-lg">
                <p className="text-xs text-gray-500 font-medium uppercase tracking-wider">{s.label}</p>
                <p className={`text-xl font-bold ${s.color}`}>{s.value}</p>
              </div>
            ))}
          </div>
        </div>

        <div className="bg-white p-6 rounded-2xl shadow-sm border border-gray-100">
          <h3 className="text-lg font-bold mb-4">Channel Volume</h3>
          <div className="h-48">
            <ResponsiveContainer width="100%" height="100%">
              <PieChart>
                <Pie data={chartData} innerRadius={40} outerRadius={60} paddingAngle={5} dataKey="value">
                  {chartData.map((entry, index) => <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />)}
                </Pie>
                <Tooltip />
              </PieChart>
            </ResponsiveContainer>
          </div>
          <div className="mt-4 space-y-2">
            {chartData.map((d, i) => (
              <div key={d.name} className="flex justify-between items-center text-sm">
                <span className="flex items-center gap-2">
                  <div className="w-3 h-3 rounded-full" style={{ backgroundColor: COLORS[i] }}></div>
                  {d.name}
                </span>
                <span className="font-bold">{d.value}</span>
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* Main Content - Ticket List */}
      <div className="lg:col-span-3 space-y-6">
        <div className="bg-white rounded-2xl shadow-sm border border-gray-100 overflow-hidden">
          <div className="p-6 border-b border-gray-100 flex flex-wrap justify-between items-center gap-4">
            <h2 className="text-2xl font-bold">Active Tickets</h2>
            <div className="flex gap-2 bg-gray-100 p-1 rounded-lg">
              {['all', ...Object.values(TicketStatus)].map(s => (
                <button
                  key={s}
                  onClick={() => setFilter(s as any)}
                  className={`px-3 py-1.5 rounded-md text-sm font-medium transition-all ${
                    filter === s ? 'bg-white text-blue-600 shadow-sm' : 'text-gray-500 hover:text-gray-700'
                  }`}
                >
                  {s.split('_').map(word => word.charAt(0).toUpperCase() + word.slice(1)).join(' ')}
                </button>
              ))}
            </div>
          </div>

          <div className="overflow-x-auto">
            <table className="w-full text-left">
              <thead className="bg-gray-50 text-xs font-semibold text-gray-500 uppercase tracking-wider">
                <tr>
                  <th className="px-6 py-4">Customer</th>
                  <th className="px-6 py-4">Subject</th>
                  <th className="px-6 py-4">Channel</th>
                  <th className="px-6 py-4">Status</th>
                  <th className="px-6 py-4">Created</th>
                  <th className="px-6 py-4">Actions</th>
                </tr>
              </thead>
              <tbody className="divide-y divide-gray-100">
                {filteredTickets.map(t => (
                  <tr key={t.id} className="hover:bg-blue-50/30 transition-colors">
                    <td className="px-6 py-4">
                      <div className="font-medium text-gray-900">{t.customer_name}</div>
                      <div className="text-xs text-gray-500">{t.customer_email}</div>
                    </td>
                    <td className="px-6 py-4">
                      <div className="text-sm font-medium text-gray-900 line-clamp-1">{t.subject}</div>
                      <div className="text-xs text-gray-400 italic">{t.category}</div>
                    </td>
                    <td className="px-6 py-4 text-center">
                      <span title={t.source_channel} className="text-xl">{CHANNEL_ICONS[t.source_channel]}</span>
                    </td>
                    <td className="px-6 py-4">
                      <span className={`px-2.5 py-1 rounded-full text-xs font-bold uppercase ${STATUS_COLORS[t.status]}`}>
                        {t.status.replace('_', ' ')}
                      </span>
                    </td>
                    <td className="px-6 py-4 text-xs text-gray-500">
                      {new Date(t.created_at).toLocaleDateString()}
                    </td>
                    <td className="px-6 py-4">
                      <button 
                        onClick={() => setSelectedTicket(t)}
                        className="text-blue-600 hover:text-blue-800 font-semibold text-sm underline"
                      >
                        View Thread
                      </button>
                    </td>
                  </tr>
                ))}
                {filteredTickets.length === 0 && (
                  <tr>
                    <td colSpan={6} className="px-6 py-12 text-center text-gray-400 italic">No tickets found matching this filter.</td>
                  </tr>
                )}
              </tbody>
            </table>
          </div>
        </div>
      </div>

      {/* Ticket Modal */}
      {selectedTicket && (
        <div className="fixed inset-0 bg-black/50 backdrop-blur-sm z-50 flex items-center justify-center p-4">
          <div className="bg-white rounded-2xl w-full max-w-3xl max-h-[90vh] flex flex-col shadow-2xl">
            <div className="p-6 border-b border-gray-100 flex justify-between items-center">
              <div>
                <div className="flex items-center gap-3 mb-1">
                  <h3 className="text-xl font-bold">Ticket: {selectedTicket.subject}</h3>
                  <span className={`px-2 py-0.5 rounded-full text-[10px] font-black uppercase ${STATUS_COLORS[selectedTicket.status]}`}>
                    {selectedTicket.status.replace('_', ' ')}
                  </span>
                </div>
                <p className="text-sm text-gray-500">History with {selectedTicket.customer_email}</p>
              </div>
              <div className="flex items-center gap-4">
                {selectedTicket.status !== TicketStatus.AWAITING_HUMAN && (
                  <button 
                    onClick={handleHandover}
                    className="px-4 py-2 bg-purple-100 text-purple-700 text-sm font-bold rounded-lg hover:bg-purple-200 transition-colors flex items-center gap-2 border border-purple-200"
                  >
                    <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M16 7a4 4 0 11-8 0 4 4 0 018 0zM12 14a7 7 0 00-7 7h14a7 7 0 00-7-7z" /></svg>
                    Human Handover
                  </button>
                )}
                <button onClick={() => setSelectedTicket(null)} className="p-2 hover:bg-gray-100 rounded-full">
                  <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" /></svg>
                </button>
              </div>
            </div>

            <div className="flex-1 overflow-y-auto p-6 space-y-6 bg-gray-50">
              {selectedTicket.messages.map(m => (
                <div key={m.id} className={`flex ${m.role === 'customer' ? 'justify-start' : m.role === 'system' ? 'justify-center' : 'justify-end'}`}>
                  {m.role === 'system' ? (
                    <div className="bg-gray-200/50 text-gray-500 text-[11px] font-bold uppercase px-4 py-1.5 rounded-full tracking-wider border border-gray-200">
                      {m.content}
                    </div>
                  ) : (
                    <div className={`max-w-[80%] p-4 rounded-2xl shadow-sm ${
                      m.role === 'customer' ? 'bg-white text-gray-800 rounded-tl-none border border-gray-100' : 'bg-blue-600 text-white rounded-tr-none'
                    }`}>
                      <div className="flex justify-between items-center mb-1 gap-4">
                        <span className="text-[10px] font-bold uppercase tracking-widest opacity-60">
                          {m.role === 'customer' ? 'Customer' : 'Digital FTE'}  {m.channel}
                        </span>
                        {m.sentiment_score !== undefined && (
                          <span className="text-[10px] bg-white/20 px-1.5 rounded">
                            AI Sentiment: {(m.sentiment_score * 100).toFixed(0)}%
                          </span>
                        )}
                      </div>
                      <p className="text-sm whitespace-pre-wrap leading-relaxed">{m.content}</p>
                      <div className="mt-2 text-[10px] text-right opacity-60">
                        {new Date(m.created_at).toLocaleTimeString()}
                      </div>
                    </div>
                  )}
                </div>
              ))}
              {selectedTicket.status === TicketStatus.ESCALATED && (
                <div className="bg-red-50 border border-red-100 p-4 rounded-xl text-red-800 text-sm italic text-center">
                   This ticket was escalated to human support by the AI.
                  <br/>
                  Reason: {selectedTicket.resolution_notes || 'High severity detection'}
                </div>
              )}
            </div>

            <div className="p-4 border-t border-gray-100 bg-white">
               <div className="flex gap-2">
                 <input 
                  type="text" 
                  placeholder="Human takeover - Type a reply..." 
                  className="flex-1 px-4 py-2 bg-slate-900 text-white border border-slate-700 rounded-lg outline-none focus:ring-2 focus:ring-blue-500 placeholder:text-slate-500"
                />
                 <button className="px-4 py-2 bg-blue-600 text-white font-bold rounded-lg">Send</button>
               </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};
